import './App.css';
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import {NavBar} from "./components/Navbar/navbar";
import {Main} from "./components/Main/main";
function App() {
  return (
      <Router>
          <Routes >
              <Route path="/" element={[<NavBar />, <Main />]}/>
          </Routes>


      </Router>
  );
}

export default App;
